import React, { Component } from 'react';
import './Error404.css'


class Error404 extends Component {

    render() {
        return (
            <div className='error-body'> <br/><br/><br/><br/><br/><br/>
            <h1>ERROR 404: PAGE NOT FOUND</h1>
            </div>
        );
    }
}

export default Error404;
